/* USER CODE BEGIN 4 */
static void AI_Init(void)
{
  ai_error err;

  /* Create a local array with the addresses of the activations buffers */
  const ai_handle act_addr[] = {activations};
  /* Create an instance of the model */
  err = ai_bilstm_model_create_and_init(&network, act_addr, NULL);
  if (err.type != AI_ERROR_NONE)
  {
    printf("ai_network_create error - type=%d code=%d\r\n", err.type, err.code);
    Error_Handler();
  }
  ai_input = ai_bilstm_model_inputs_get(network, NULL);
  ai_output = ai_bilstm_model_outputs_get(network, NULL);
}

static void AI_Run(float *pIn, float *pOut)
{
  char logStr[100];
  int count = 0;
  float max = 0;
  ai_i32 batch;
  ai_error err;

  /* Update IO handlers with the data payload */
  ai_input[0].data = AI_HANDLE_PTR(pIn);
  ai_output[0].data = AI_HANDLE_PTR(pOut);

  batch = ai_bilstm_model_run(network, ai_input, ai_output);
  if (batch != 1)
  {
    err = ai_bilstm_model_get_error(network);
  }
  for (uint32_t i = 0; i < AI_NETWORK_OUT_1_SIZE; i++)
  {

    if (max < aiOutData[i])
    {
      count = i;
      max = aiOutData[i];
    }
  }
}
